import React, { useState } from "react";

const GetTime = () => {
  const [time, setTime] = useState("");
  const Time = new Date();
  const getTime = () => {
    return setTime(Time);
  };
  return (
    <>
      <h1>{time}</h1>
      <button onClick={getTime}></button>
    </>
  );
};

export default GetTime;
